beforeHooks.code:
driver = await getDriver();
loginPage = new LoginPage(driver);
inventoryPage = new InventoryPage(driver);
cartPage = new CartPage(driver);
await loginPage.open();
await loginPage.login('standard_user', 'secret_sauce');

tests.code:
await inventoryPage.addFirstItemToCart();
const badge = await driver.findElement(By.css('.shopping_cart_badge')).getText();
assert.equal(badge, '1');

await inventoryPage.openCart();
await cartPage.proceedToCheckout();
const url = await driver.getCurrentUrl();
assert.include(url, 'checkout-step-one.html');

await loginPage.open();
await loginPage.login('standard_user', 'secret_sauce');
const url = await driver.getCurrentUrl();
assert.include(url, 'inventory.html');

await loginPage.open();
await loginPage.login('invalid_user', 'wrong_pass');
const errorText = await loginPage.getErrorMessage();
assert.include(errorText.toLowerCase(), 'epic sadface');

